import React, { Fragment } from "react";
import { Form, Input, Button, Row, Col, Select, InputNumber } from "antd";

const layout = {
  labelCol: { span: 3 },
  wrapperCol: { span: 16 }
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 }
};

const { Option } = Select;

const PersonalForm = ({
  firstName,
  lastName,
  gender,
  Address,
  password,
  phoneNumber,
  workPosition,
  age,
  salary,
  email,
  date,
  onClose,
  onhandleAdd
}) => {
  return (
    <Fragment>
      <Form
        {...layout}
        name="basic"
        onFinish={onhandleAdd}
        hideRequiredMark
        className="m-0"
      >
        <Form.Item
          label={firstName}
          name={firstName}
          rules={[{ required: true, message: `Please input ${firstName}` }]}
        >
          <Input allowClear />
        </Form.Item>

        <Form.Item
          label={lastName}
          name={lastName}
          rules={[{ required: true, message: `Please input ${lastName}` }]}
        >
          <Input allowClear />
        </Form.Item>
        <Form.Item
          label={gender}
          name={gender}
          rules={[{ required: true, message: `Please choose ${gender}` }]}
        >
          <Select>
            <Option default value="Male">
              Male
            </Option>
            <Option value="Female">Female</Option>
          </Select>
        </Form.Item>
        <Form.Item
          label={Address}
          name={Address}
          rules={[{ required: true, message: `Please input ${Address}` }]}
        >
          <Input allowClear />
        </Form.Item>

        <Form.Item
          label={password}
          name={password}
          rules={[{ required: true, message: `Please input ${password}` }]}
        >
          <Input.Password />
        </Form.Item>
        <Form.Item
          label={phoneNumber}
          name={phoneNumber}
          rules={[{ required: true, message: `Please input ${phoneNumber}` }]}
        >
          <InputNumber style="w-20" />
        </Form.Item>
        <Form.Item
          label={workPosition}
          name={workPosition}
          rules={[{ required: true, message: `Please choose ${workPosition}` }]}
        >
          <Select>
            <Option default value="Chef">
              Chef
            </Option>
            <Option value="Waiter">Waiter</Option>
            <Option value="Manager">Manager</Option>
            <Option value="Cleaner">Cleaner</Option>
          </Select>
        </Form.Item>
        <Row>
          <Col span={5}>
            <Form.Item {...tailLayout}>
              <Button type="primary" htmlType="submit">
                Add
              </Button>
            </Form.Item>
          </Col>
          <Col span={5}>
            <Form.Item {...tailLayout}>
              <Button type="danger" onClick={onClose}>
                Cancel
              </Button>
            </Form.Item>
          </Col>
        </Row>
      </Form>
    </Fragment>
  );
};
export default PersonalForm;

